egiste. No hay elección correcta o incorrecta. Sólo hay elección.\n++one_third&&fa-bank&&#&&Solidez&&Tu puedes tener la consciencia de lo que te gustaría que fuera tu vida y en la clase de COP recibirás las herramientas para empoderarte a elegir y crearla.','GALERIAS BARRAS&&¡ELECCIÓN DE POSIBILIDADES!++one_third first&&clase.jpg&&#&&Tu mismo&&\n\nAccess Consciousness te permite cambiar cualquier cosa que no has podido cambiar y crear todo lo que deseas de una forma diferente y fácil.\n++one_third&&1807ca860ac3e5331853de5be26c3f25.jpg&&#&&Pasos Sencillos&&Hay dos cosas que cambiarán cualquier cosa en tu vida, la elección y las Barras de Access. Descubre la sencillez de este proceso corporal que está cambiando el mundo. ++one_third&&images.jpg&&#&&Acercate&&\n\nUna selección de clases traducidas con los cocreadores de Access Consciousness así como con otros facilitadores que están ofreciendo clases en español ¡Echa un vistazo a lo que viene!\n++one_third first&&tfc-es-crop.jpg&&#&&Info&&\n\nAccess Consciousness está en todo el mundo y muchas de sus clases son traducidas a más de 20 idiomas. Más información sobre cómo trabajamos con idiomas aquí.\n++one_third&&indice.jpg&&#&&Barras&&Access\n\nConsciousness son\n\nuna serie de\n\nherramientas,\n\ntécnicas y filosofías\n\nque te permiten crear\n\nun cambio dinámico\n\nen áreas de tu vida, tu\n\ncuerpo y en ti mismo.++one_third&&imagese.jpg&&#&&cultiva felicidad&&Date una oportunidad para q conozcas a Barras Access','Galeria Cursos y Talleres&&Hoy en día casi todas las personas sufrimos una sobrecarga de información en la mente. Tanto es así que no es raro padecer estrés, insomnio, desórdenes psicológicos de todo tipo y, en el mejor de los casos, una o varias voces internas que crean un ruido constante y limitante que enturbia nuestra vida.\n++one_third first&&barrasoaxaca.JPG&&#&&Curso Oaxaca&&¿Te gustaría eliminar de tu cabeza todo lo que te limita?\n&&Ver Curso++one_third&&flyer_barras_2_portal.jpg&&#&&Barras Personalizadas&&Te gustaría estar más alegre y atraer la abundancia a tu vida?&&Accede al curso++one_third&&mty.jpg&&#&&Monterrey&&Todo en la vida viene a mí con facilidad, alegría y gloria&&Ver Curso++one_third first&&imxages.jpg&&#&&CDMX&&Cada una de estas barras contiene información sobre determinadas áreas de la vida (dinero, control, creatividad, poder, sexualidad, cuerpo, envejecimiento, alegría, tristeza, etc.).\n&&Leer mas++one_third&&imagsses.jpg&&#&&Barras Grupales&&La información que dichas barras contienen son los puntos de vista que has ido creando y haciendo significativos a lo largo de tu existencia y que, de una forma u otra, te mantienen anclado y te impiden mejorar en algún aspecto de tu vida.&&barras grupales++one_third&&imagessss.jpg&&#&&Agenda tu Barra Access&&En este estado de la mente, el inconsciente comienza a soltar y eliminar la basura acumulada durante años de forma suave y placentera. El segundo síntoma suele ser una sensación de paz y claridad mental&&Leer mas',NULL,NULL,NULL),('bronea-body','bronea',NULL,'medicina-holistica.jpg++titulo++subtitutlo++Cita++Ingresa',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'titulo&&subTitulo&&Lorem ipsum dolor sit amet|  maiores| ratione magni voluptas odio ex soluta quidem. Optio quos| quae iusto beatae repudiandae! Fugit incidunt non in eum totam tenetur vitae officia similique.&&Lorem ipsum dolor sit amet| consectetur adipisicing elit. Nobis maiores| ratione magni voluptas odio ex soluta quidem. Optio quos| quae iusto beatae repudiandae! Fugit incidunt non in eum totam tenetur vitae officia similique.&&medicina-holistica.jpg++one_half first&&#&&fa-balance-scale&&tituloObjeto1&&is maiores| ratione magni voluptas odio ex soluta quidem. Optio quos| quae iusto beatae repudiandae! Fugit incidunt non in eum totam tenetur vitae officia similique.++one_half&&#&&fa-angellist&&tituloObjeto&&is maiores| ratione magni voluptas odio ex soluta quidem. Optio quos| quae iusto beatae repudiandae! Fugit incidunt non in eum 